import React from "react";
import Card from "../Card";
import {
  WorkBg,
  WorkContainer,
  WorkContent,
  WorkFrost,
  AboutFrost2,
  CardColumn,
  CardBg,
  CardBtn,
} from "./WorkElms";

const Work = () => {
  return (
    <WorkContainer id="work">
      <WorkFrost />
      <AboutFrost2 />
      <WorkBg>
        <WorkContent>
          <CardColumn>
            <Card>
              <CardBg />
            </Card>
          </CardColumn>
        </WorkContent>
      </WorkBg>
    </WorkContainer>
  );
};
export default Work;
